import React from "react";
import styled from "@emotion/styled";

const Icon = (props) => {
  const Icon = styled.img`
    width: 40%;
  `;

  return <Icon src="./img/Fog-2x.png" alt="Weather Icon"></Icon>;
};

export default Icon;
